import React from 'react'
import Particles from 'react-particles-js'
import './ListItem.css'

const ListItem = (props) =>{
    const items = props.items
    if (items.length != 0){
        const listItems = items.map(item => {
            return <p className="list" key="item.key"><span>{item.text} <img src="https://img.icons8.com/wired/64/000000/empty-trash.png" height="20" /> </span></p>
        })
        return (
            <div>{listItems}

            </div>
        )
    } else {
        return (
            <div></div>
        )
    }

}

export default ListItem
